import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for posts to load
    await page.waitForSelector('.posts');

    // Extract hashtags and like counts
    const hashtags = await page.evaluate(() => {
      const captions = Array.from(document.querySelectorAll('.post-caption .caption-text'));
      return captions.flatMap(caption => {
        const matches = caption.innerText.match(/#\w+/g);
        return matches ? matches : [];
      });
    });

    const likeCounts = await page.evaluate(() => {
      const likes = Array.from(document.querySelectorAll('.post-likes'));
      return likes.map(like => like.innerText);
    });

    console.log('Extracted Hashtags:', hashtags);
    console.log('Extracted Like Counts:', likeCounts);

    return {
      success: true,
      action: "Successfully extracted hashtags and like counts",
      extractedData: {
        hashtags,
        likeCounts
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
